import React, { Component, Fragment } from 'react';
import './style.css';
import starSky from './img/starSky.png';
import whatIs5G from './img/what-is-5g.png';
import moon from './img/moon.gif';
import sun from './img/sun.gif';
import satallite from './img/satallite.gif';

class Main extends Component {
    render() {
        return (
            <Fragment>
                <div className="firstPage">
                    <div className="star"><img src={starSky} alt=""/></div>
                    <div className="moon"><img src={moon} alt=""/></div>
                    <div className="sun"><img src={sun} alt=""/></div>
                    <div className="satallite"><img src={satallite} alt=""/></div>
                    <div className="hero">
                        <div className="rotateCube"></div>
                        <div className="hero-container">
                            <div className="whatIs5G">
                                <img src={whatIs5G} alt=""/>
                                <div className="hero-glich cc-1"></div>
                                <div className="hero-glich cc-2"></div>
                                <div className="hero-glich cc-3"></div>
                                <div className="hero-glich cc-4"></div>
                                <div className="hero-glich cc-5"></div>
                                <div className="hero-glich cc-6"></div>
                                <div className="hero-glich cc-7"></div>
                                <div className="hero-glich cc-8"></div>
                                <div className="hero-glich cc-9"></div>
                                <div className="hero-glich cc-10"></div>
                                <div className="hero-glich cc-11"></div>
                                <div className="hero-glich cc-12"></div>
                                <div className="hero-glich cc-13"></div>
                            </div>
                        </div>
                    </div>
                    <div className="linerColor"></div>
                </div>
            </Fragment>
        )
    }
}

export default Main;
